package Time_complexity;

public class Demo1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int n=1000000;
        
		for(int i=1; i<=n;i*=2) {
			
			System.out.println("Hello");
		}
		
		
		for(int i=n;i>=1; i=i/2) {
			
			System.out.println("hello");
		}
		
		
		
		
		
		
	}

}
